            "description": "*Description*\r\n\r\nIn https://jira.sie.sony.com/browse/WDY-4314 , the last mock flare component was implemented.\r\n\r\nBefore API can be integrated, this mock implementation must be refactored to receive as inputs actual API values, and pipe those through the UI, while converting raw values to presentation-friendly components.\r\n\r\nThis ticket is to finish any remaining groundwork that can be completed before API integration begins.\r\n\r\nExamples include:\r\n * refactoring subcomponents to use smaller JSX fragments\r\n * refactor interactions to use mock API stubs that are based on actual server values\r\n * make a submodule for formatting a flare and its subcomponents into a presentation-friendly model\r\n * fetch profiles for displaying user info\r\n * move flare widget contents into dedicated component module for re-use in displaying the configuration menu preview\r\n * other user experience improvements\r\n\r\n*AC*\r\n # The above refactoring items are merged\r\n\r\n ",
