            "description": "*Description*\r\n\r\nThe design for the Welcome Hub widget contains 4 variants:\r\n # Friends w/ Flares (one or more friends have a flare set)\r\n # My Flare (I have a flare set, no friends with flares)\r\n # Empty (neither I nor friends have a flare)\r\n # Error (fetching failed, etc.)\r\n\r\nThis story is to do My Flare and Empty states (2 and 3).\r\n\r\nFor the My Flare variant, logged in user's profile should be used. \r\nFor the title, any e1 title metadata will do (either retrieved via titleId, or hardcoded is fine).\r\n\r\n*AC*\r\n # Mock components for the My Flare and Empty state variants are created and merged \r\n\r\n*Resources*\r\n # Branch: [https://github.sie.sony.com/SIE-Private/rnps-explore-hub/tree/feat/custom-presence-alpha]\r\n # Figma: [https://www.figma.com/design/lWk0uyBweyFuE4ZkuCpmle/Rich-Presence-Playground?node-id=979-83551&t=gpPEbGnfbD35Qc2V-0]",
