            "timeoriginalestimate": null,
            "description": "It was determined to create a Welcome Hub widget as a proof-of-concept for the Custom Presence feature. \r\n\r\nSpec: [https://docs.google.com/presentation/d/1OOwspNCtpApe2Til8YCZt5byUeiCDeQT-NKFc9jkYeU/edit?slide=id.g35486f0e382_0_2#slide=id.g35486f0e382_0_2]\r\n\r\nWelcome Hub is now the landing page when the console boots up. The framework makes it easy for each team to implement its own widgets in a segregated environment. \r\n\r\nWidget docs: [https://github.sie.sony.com/SIE-Private/rnps-explore-hub/blob/main/packages/widget/README.md] \r\n\r\nThe outcome of this ticket should be a very rough architecture diagram, showing the server interactions and related client components as a sequence. Required API services at each step should be listed.\r\n\r\n*AC*\r\n * Results of above investigation documented and added to [https://confluence.sie.sony.com/display/PPRC1/Woody+-+Rich+Presence]\r\n\r\n*Resources*\r\n * [https://docs.google.com/presentation/d/1GsRlpJiJs7p4pob5Rcf-1CHfpcglQGbbh7cZu8DXRJg/edit?slide=id.p1#slide=id.p1]\r\n * [https://docs.google.com/document/d/1KmXx2s3ZqZmehH-bKVhTlhQbtI2G8Axc31IABRQGP7E/edit?tab=t.0#heading=h.l4d1cv13bhzm] (set up development environment for welcome hub)",
