            "timeoriginalestimate": null,
            "description": "h3. *Background*\r\n * We are planning to deliver a *POC (Proof of Concept)* for the new *Custom Presence* feature by {*}September(TBD){*}.\r\n * This story focuses on *defining the database schema* using the investigation results from MVRK-341, MVRK-343\r\n * This story focuses on designing\r\n ** The schema definition (e.g. tables, fields, relationships)\r\n ** Alignment with data access patterns expected in the POC\r\n\r\n*A/C*\r\n * Define the schema (tables, fields, types, indexes) in Document\r\n ** Explore the possibility of using AI to design the schema and document\r\n * Ensure the schema supports the expected data access and usage patterns(Nice To Have)\r\n * Review the architecture with the team",
