            "description": "h3. *Background*\r\n * We are planning to deliver a *POC (Proof of Concept)* for the new *Custom Presence* feature by {*}September(TBD){*}.\r\n * To achieve this, we need to work with *PdM and the client team (Woody)* in *June* to clarify the basic feature specifications, understand related systems, and decide on the new application’s architecture and design.\r\n * \r\nThis story is to research and evaluate possible application frameworks that can be used for this new application.\r\n * Currently, the framework candidates are\r\n\r\n * \r\n ** Lego V5\r\n ** Aang\r\n *** [https://github.sie.sony.com/SIE/aang]\r\n ** Tenzin\r\n *** [https://github.sie.sony.com/SIE/tenzin]\r\n *** [https://confluence.sie.sony.com/display/DPED/Tenzin]\r\n ** Springboot\r\n\r\n*A/C*\r\n * Research each framework from the list (Lego V5, Aang, Tenzin, Spring Boot)\r\n * Confirm the in-house framework direction in future with Technical Lead Ethan, arun\r\n * Briefly summarize pros/cons of each framework\r\n * Share findings and decide the framework with team",
