            "description": "h3. *Background*\r\n * We are planning to deliver a *POC (Proof of Concept)* for the new *Custom Presence* feature by {*}September(TBD){*}.\r\n * To achieve this, we need to work with *PdM and the client team (Woody)* in *June* to clarify the basic feature specifications, understand related systems, and decide on the new application’s architecture and design.\r\n * This story focuses on *defining the application architecture* using the investigation results from MVRK-341, MVRK-343\r\n\r\n*A/C*\r\n * The architecture should include as following,\r\n ** Selected application framework\r\n ** Basic component structure\r\n ** Data store to be used\r\n ** Sequence diagram (showing client-to-backend(downstream service) flow)\r\n ** (Nice To Have) Cache Design, it is not mandatory in POC\r\n * Document the final architecture diagram in a sharable format (e.g. Confluence )\r\n ** Include the sequence diagram with Client and Downstream service if possible\r\n ** Explore the possibility of using AI to creating the document\r\n * Review the architecture with the team",
