            "description": "h3. *Background*\r\n\r\nWe are planning to deliver a *POC (Proof of Concept)* for the new *Custom Presence* feature by {*}September(TBD){*}.\r\n\r\nTo achieve this, we need to work with *PdM and the client team (Woody)* in *June* to clarify the basic feature specifications, understand related systems, and decide on the new application’s architecture and design.\r\n\r\nThe goal of this story is to\r\n * Requirement discussion and alignment with stakeholders(PdM/Woody/Team)\r\n\r\n * Documentation of agreed specs and design\r\n\r\n * Sharing with team members and getting feedback\r\n\r\n*A/C*\r\n * {*}Conduct multiple Deep Dive meetings with PdM and Woody to reach agreement on the POC requirements{*}, covering the following points\r\n ** What data needs to be stored \r\n ** Estimated scale of requests once the feature is public\r\n ** Whether mobile support is required, and if there are differences in requirements across platforms\r\n ** Identify relevant downstream services and assess integration needs\r\n ** Agree on a basic data flow with the client team (a sequence diagram would be ideal)\r\n * *Proactively propose suggestions* or requirement drafts from our side when possible\r\n ** Allow our engineers to join the Deep Dive sessions to give technical feedback\r\n ** Explore the possibility of using AI to propose specifications.\r\n * {*}Document the final agreed specifications and architectural design{*}, and complete reviews with Maverick\r\n ** Use diagrams (like sequence diagrams) if needed\r\n ** It is also good to include non-functional requirements (like performance and scalability)\r\n\r\nSupplement\r\n * Draft UI flow: [https://www.figma.com/board/TnJ0nW7hDQKqvdlUGEMd7F/Custom-Presence-Whiteboard?node-id=214-166&t=YECK3TooUwSCw9qc-0]\r\n * Initial Spec for Slice 1:[https://docs.google.com/presentation/d/1OOwspNCtpApe2Til8YCZt5byUeiCDeQT-NKFc9jkYeU/edit?slide=id.g365cc2c0a35_0_40#slide=id.g365cc2c0a35_0_40]",
